			<view class="wrapper">
				<view class="avatar-wrap acea-row">
					<image class="avatar" :src="userInfo.imageUrl"></image>
					<view class="text">
						<view class="name line1">{{userInfo.name}}</view>
						<view class="tips" v-if="userInfo.is_ever_level">永久SVIP会员</view>
						<view class="tips" v-else-if="userInfo.is_money_level">{{userInfo.overdue_time | dateFormat}} 到期</view>
						<view class="arrow">{{userInfo.phone}}<text class="iconfont icon-ic_rightarrow"></text></view>
					</view>
				</view>
			</view>
		</view>
		<!-- 选择卡种 -->
		<view class="other-section">
			<view class="type-section" id="card" v-if="memberType.length && !userInfo.is_ever_level">
				<view class="type-section-inner">
					<view class="title acea-row row-between-wrapper">
						<view class="">选择卡种</view>
					</view>
					<scroll-view class="scroll" scroll-x="true">
						<view v-for="item in memberType" :key="item.id" class="item" :class="{on: item.id === svip.id}" @click="checkType(item)">
							<view class="name">{{item.name}}</view>
							<view class="new">￥<text class="num">{{item.price}}</text></view>
							<view class="button" v-if="item.type==1">有效期：7天</view>
							<view class="button" v-if="item.type==2">有效期：1个月</view>
							<view class="button" v-if="item.type==3">有效期：3个月</view>
							<view class="button" v-if="item.type==4">有效期：1年</view>
							<view class="button" v-if="item.type==5" >有效期：长期</view>
							<view class="button" v-if="item.type==6" >有效期：{{item.month}}个月</view>
						</view>
					</scroll-view>
				</view>
			</view>
			<view class="content">
				<view class="title">
					会员卡权益
				</view>
				<view class="info">
					购买会员的用户可观看会员有效期内的所有课程
					本文将从以下三个方面的介绍，提供互联网会员权益设计的参考：
					主要有哪些会员升级的模式；
					会员的权益主要有哪些分类；
					消费升级，即通过购买直接获得会员升级，如脉脉、腾讯视频、有道云笔记的会员等。
				</view>
			</view>
