	</view>
</template>

<script>
	import colors from '@/mixins/color.js';
	import {
		mapGetters
	} from "vuex";
	import { getUserInfo,getCardList } from '@/api/user';
	import {
		orderConfirm
	} from '@/api/order.js';
	import {
		toLogin
	} from '@/libs/login.js';

	export default {
		components: {
		},
		mixins: [colors],
		filters: {
			dateFormat: function(value) {
				return dayjs(value * 1000).format('YYYY-MM-DD');
			},
			moneyFormat: function(value) {
				return parseFloat(value);
			}
		},
		computed: mapGetters(['isLogin']),
		data() {
			return {
				memberType: [],
				userInfo: {},
				pay_order_id: '',
				totalPrice: '0',
				finished: false,
				memberEndTime: '',
				// #ifdef H5
				isWeixin: this.$wechat.isWeixin(),
				// #endif
				type: '',
				svip: {},
				isShowAuth: false,
				// #ifdef MP
				iconColor: '#FFFFFF',
				isScrolling: false,
				// #endif
			}
		},
		onLoad() {
			let that=this;
			console.log(this.isLogin)
			if (this.isLogin) {
				getUserInfo().then(res => {
					that.userInfo=res.data;
				});
				this.onLunch();
			} else {
				toLogin();
			}
		},
		onReachBottom() {
			this.groomList();
		},
		onPageScroll(e) {
			uni.$emit('scroll');
			// #ifdef MP
			if (e.scrollTop > 50) {
				this.isScrolling = true;
				this.iconColor = '#333333';
			} else if (e.scrollTop < 50) {
				this.isScrolling = false;
				this.iconColor = '#FFFFFF';
			}
			// #endif
		},
		methods: {
			onLunch() {
				this.memberCard();
			},
			pay: function() {
					console.log("s")
					let that=this;
					let winingIndex = this.memberType.findIndex(item => {
						return item.id == that.svip.id;
					});
					let val=this.memberType[winingIndex];
					let data={
							goodsNumber:val.number,
							goodsType:"card-VIP",//（course-课程，card-VIP）
					}
					orderConfirm(data).then(res => {
						console.log(res)
						let content=res.data
						if(content.orderStatus==1){
							//提示需要完成以前的订单
							uni.showModal({
								title: "提示",
								cancelText: "再想想",
								confirmText: "去支付",
								content: "已有未支付的订单",
								success: function (res) {
									if (res.confirm) {
										uni.navigateTo({
											// url: `/pages/order/order_detail/index?number=${content.orderNumber}`
											url: `/pages/order/order_detail/index?number=${content.orderNumber}&goodsType=card-VIP`
										})
									} else if (res.cancel) {
									
									}
								}
							});
						}else{
							uni.navigateTo({
								url: `/pages/order/order_confirm/index?number=${val.number}&goodsType=card`
							})
						}
					}).catch((error) => {
							uni.showToast({
									title: error,
									icon: 'none',
									duration: 2000
							});
					});
				
			},
			scrollToCard() {
				const query = uni.createSelectorQuery().in(this);
				query.select('#card').boundingClientRect(data => {
					uni.pageScrollTo({
						scrollTop: data.top
					});
				}).exec();
			},
			goDetail(id) {
				uni.navigateTo({
					url: `/pages/goods_details/index?id=${id}`
				});
			},
			// 付费会员数据
			memberCard() {
				uni.showLoading({
					title: '正在加载…'
				});
				let that=this
				getCardList().then(res => {
					uni.hideLoading();
					that.memberType=res.rows
					that.svip = that.memberType[0];
					this.totalPrice = parseFloat(that.memberType[0].price);
				})
			},
			checkType(svip) {
				this.type = svip.type;
				this.svip = svip;
				this.totalPrice = parseFloat(svip.price)
			},
			memberSelect(index) {
				this.memberSelected = index;
			},
			goRightDetail() {
				uni.navigateTo({
					url: `/pages/annex/vip_paid_rights/index`
				});
			},
		}
	}
</script>

